+)
+
+type MonitorProxyAdapter struct {
+    drivenAdapter drivens.MonitorDrivenPort
+}
+
+func NewMonitorProxyAdapter(drivenAdapter drivens.MonitorDrivenPort) *MonitorProxyAdapter {
